package br.com.challenges.easy;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;

class IsSubsequenceTest {

    @Test
    public void teste1() {
        IsSubsequence is = new IsSubsequence();
        assertTrue(is.isSubsequence("abc", "ahbgdc"));
    }

    @Test
    public void teste2() {
        IsSubsequence is = new IsSubsequence();
        assertFalse(is.isSubsequence("axc", "ahbgdc"));
    }

    @Test
    public void teste3() {
        IsSubsequence is = new IsSubsequence();
        assertFalse(is.isSubsequence("aec", "abcde"));
    }

    @Test
    public void teste4() {
        IsSubsequence is = new IsSubsequence();
        assertFalse(is.isSubsequence("aaaaaa", "bbaaaa"));
    }

    @Test
    public void teste5() {
        IsSubsequence is = new IsSubsequence();
        assertTrue(is.isSubsequence("leeeeetcode", getStringTeste()));
    }

    @Test
    public void teste6() {
        IsSubsequence is = new IsSubsequence();
        assertFalse(is.isSubsequence("bb", "ahbgdc"));
    }

    private String getStringTeste() {
        return "";
    }
}